import BingoBoard from "../components/BingoBoard";
import "./ResultsPage.css";
import Accordion from "../components/Accordion";
import RankingBoard from "../components/RankingBoard";

// import mbtiimg from `../images/${realMbti}.png`;

// const myMbtiCount = localStorage.getItem("myMbtiCount")

function ResultsPage() {
  const myName = localStorage.getItem("myName");
  const myMbti = localStorage.getItem("myMbti");
  const myMbtiBoard = JSON.parse(localStorage.getItem("myMbtiBoard"));
  const myMistypes = JSON.parse(localStorage.getItem("myMistypes"));
  const mistypeBoardArray = JSON.parse(
    localStorage.getItem("mistypeBoardArray")
  );

  let testByRankArray = [
    { mbti: "INFP", count: "18" },
    { mbti: "ISFJ", count: "16" },
    { mbti: "ENFP-Fi", count: "12" },
    { mbti: "ISFP", count: "11" },
  ];

  // 이거 대신 mistypeboardarray 안에 있는 id 사용하는 게 낫나?
  let myMistypesIds = myMistypes.map((item) => item.id);

  // // 준우 test data (원래 예상대로인 케이스)
  // const testMistypeCountArray = [12, 11, 16];

  // // 내 test data (알고보니 다른 케이스)
  // const myMbtiCount = 15;
  // const testMistypeCountArray = [17, 8, 9];

  // test data (두가지 선택개수가 똑같은 케이스)

  // const realMbti = "ENFP";
  const realMbtiCount = "test";

  // 왜 결과값이 아니라 코드가 그대로 출력되지?
  // let myMbtiCount = (array) => {
  //   let count = 0;
  //   for (let i = 0; i < myMbtiBoard.length; i++) {
  //     count += array[i].filter(Boolean).length;
  //   }
  //   return count;
  // };

  console.log(
    myMbtiBoard
      .map((row) => row.filter(Boolean).length)
      .reduce((a, b) => a + b, 0)
  );

  // THIS!!!!
  // let trueCount = (board) => {
  //   board.map((row) => row.filter(Boolean).length)
  // };
  let trueCount = (board) => {
    let count = 0;
    for (let i = 0; i < board.length; i++) {
      count += board[i].filter(Boolean).length;
    }
    return count;
  };

  // trueCount map으로 쓰는 법?

  // let trueCount = (board) => {
  //   counter = 0;
  //   board.map((array, counter) => {
  //     return (counter += array.filter(Boolean).length);
  //   });
  // };

  // let sum = (r, a) => r.map(b, i) => a[i] + b;

  // let trueCount = (board) => {
  //   return board.map((array) => {
  //     return array.filter(Boolean).length;
  //   });
  // };

  // let trueCount = (board) => {
  //   return (
  //     (sum) =>
  //       sum.reduce( ()
  //         board.map((array) => {
  //           return array.filter(Boolean).length;
  //         })
  //       ),
  //     0
  //   );
  // };

  let myMbtiCount = trueCount(myMbtiBoard);
  // console.log(myMbtiCount);

  // !! MISTYPE COUNT

  // let mistypeCount = trueCount(mistypeBoardArray[2].board);
  // console.log(mistypeBoardArray[0]);

  // let mistypeCountArray = [];

  // let mistypeCount = mistypeBoardArray.map((board) => {id: board.mbti, count: trueCount(board)})

  // 각 id는 잘 들어가는데 truecount가 제대로 동작을 안 함. 다 0개라고 나옴.
  // let mistypeCount = mistypeBoardArray.map((board) => ({
  //   [board.mbti]: trueCount(board),
  // }));

  let mistypeCount = mistypeBoardArray.map((item) => {
    return {
      id: item.mbti,
      count: trueCount(item.board),
    };
  });

  let mbtiRanking = [
    ...mistypeCount,
    {
      id: myMbti,
      count: trueCount(myMbtiBoard),
    },
  ].sort((a, b) => {
    return b.count - a.count;
  });

  // let addMistypeCount = (mistypeBoardArray) => {
  //   let newMistypeBoardArray = [...mistypeBoardArray];
  //   newMistypeBoardArray.map((board) => {
  //     board.push(trueCount(board));
  //   });
  //   return newMistypeBoardArray;
  // };

  // console.log(addMistypeCount);

  // let addCount = (array) => {
  //   let newArray = [...array];
  //   newArray.map((item) => {item.push([item.count]: trueCount(item.board))
  //   })
  //   return newArray
  // }

  // const realMbti = Math.max.apply(myMbtiCount, testMistypeCountArray);
  // console.log(realMbti);

  // const realMbti = Math.max.apply(myMbtiCount, mistypeCount.count);

  // console.log(mistypeCount.map((item) => item.count));

  // console.log([
  //   5,
  //   ...mistypeCount.map((obj) => {
  //     return obj.count;
  //   }),
  // ]);

  // const realMbti = Math.max.apply([
  //   myMbtiCount,
  //   ...mistypeCount.map((obj) => {
  //     return obj.count;
  //   }),
  // ]);

  const realMbti = mbtiRanking[0].id;

  return (
    <>
      {/* <h1>결과</h1> */}

      {/* conditional rendering. if myMbti !== realMbti */}

      <div className="conclusion">
        <div className="headline accent highlight">
          {myName}님의 진짜 MBTI는 {realMbti}입니다
        </div>
        {/* <img src={`../images/${realMbti}.png`} width="100%" /> */}
        {/* <img src={`../images/infp.png`} width="100%" /> */}
        {/* <img src={mbtiimg} width="300px" /> */}
        {/* public folder에 이미지 폴더 넣으면 따로 import 안 해도 불러올 수 있음 */}
        <img
          src={require(`../images/${realMbti.toLowerCase()}.png`)}
          width="100%"
        />
        {/* <td>
          <div className="img-container">
            <img className="top" src={`images/${realMbti}.png`} width="80%" />
            <img className="bottom" src={"images/circle.png"} width="80%" />
          </div>
        </td> */}
      </div>

      <div className="result">
        <div className="ranking">
          <RankingBoard ranking={testByRankArray} />
        </div>
        {/* <div className="result-count">
          각 빙고판에서 {myMbti}는 {myMbtiCount}개, <br />
          {realMbti}는 {realMbtiCount}개 선택했어요. <br />
        </div> */}
        <div className="result-summary">
          알고 보면 {myName} 님은 사실 {myMbti}보다 {realMbti}의 성향에 더
          가깝다는 것!
        </div>
      </div>

      <div className="mystery-reveal-title">
        <p>미스테리 빙고의 정체를 공개합니다!</p>
        <div>
          {/* {myMbti}들은 종종 {myMistypes.id.join(", ")}들과 혼동되기도 해요. */}
          {myMbti}들은 종종{" "}
          <span className="mistype-names">{myMistypesIds.join(", ")}</span>들과{" "}
          <br></br> 혼동되기도 해요.
        </div>
      </div>
      <div className="mistype-container">
        <div className="mistype-title">
          미스테리 빙고 #1 <span className="accent highlight">ENFP</span>
        </div>
        {/* <div className="mystery-reveal-title">미스테리 빙고 #1: {mbti}</div> */}
        <div className="bingo-reveal">
          <BingoBoard
            mbti={mistypeBoardArray[0].mbti.slice(0, 4)}
            board={mistypeBoardArray[0].board}
            show={true}
            disableClick={true}
          />
        </div>
        <div className="mistype-reason">
          <Accordion myMbti={myMbti} />
        </div>
      </div>
    </>
  );
}

export default ResultsPage;
